  false,\n\t\"url\": null,\n\t\"notes\": \"A breeding bird study was initiated in
  1992 to census birds on the Gardner Division of Mark Twain NWR. The division is
  located in the Mississippi River floodplain north of Quincy, Illinois. The study
  was canceled in 1993 due to severe flooding. A more extensive study was conducted
  in June 1994 to include breeding birds and vegetation analysis. The purpose of the
  ongoing study is to: 1) estimate the number of bird species and their relative abundance;
  2) analyze the vegetation after the flood. A total of 66 bird species were heard
  or observed on the refuge during June 1994.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
